    <Navbar bg="light" variant="light">
        <Container>
        <Navbar.Brand href="#home">Movies</Navbar.Brand>
        <Nav className="me-auto">
          <Button variant="outline-success"  onClick={() => setShow(!show)} >Add New Movie</Button>
        </Nav>
        <Form className="d-flex">
              <FormControl
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
        </Form>
        </Container>
        <AddMovie />
    </Navbar>

    )
}
export default NavBar;
